import React, { Component } from 'react'
import { connect } from 'react-redux'
import UpdateHeadline from './UpdateHeadline';

export class UserStatus extends Component {
  render() {
    return (
      <div className='bg-sky-100 rounded-lg p-10 flex flex-col'>
        <div className='flex flex-col items-center '>
          <img src="https://mir-s3-cdn-cf.behance.net/project_modules/disp/8394f798931623.5ee79b6a909ea.jpg" className='rounded w-20'/>
          <div>{this.props.user.username}</div>
          <div>{this.props.headline}</div>
        </div>
        <UpdateHeadline/>
      </div>
    )
  }
}

const mapStateToProps = (state) => {
    return {
        user: state.riceZoneApp.currentUser,
        headline: state.riceZoneApp.userHeadline
    }
  };

const mapDispatchToProps = {}

export default connect(mapStateToProps, mapDispatchToProps)(UserStatus)
